{
  "name": "UBX-NAV-SOL",
  "class_id": "0x01",
  "message_id": "0x06",
  "description": "Navigation solution information. This message combines position, velocity and time solution in ECEF, including accuracy figures. This message has only been retained for backwards compatibility; users are recommended to use the UBX-NAV-PVT message in preference.",
  "message_type": "output",
  "payload": {
    "length": {
      "fixed": 52
    },
    "fields": [
      {
        "name": "iTOW",
        "byte_offset": 0,
        "data_type": "U4",
        "description": "GPS time of week of the navigation epoch. See the description of iTOW for details.",
        "unit": "ms"
      },
      {
        "name": "fTOW",
        "byte_offset": 4,
        "data_type": "I4",
        "description": "Fractional part of iTOW (range: +/- 500000). The precise GPS time of week in seconds is: (iTOW * 1e-3) + (fTOW * 1e-9)",
        "unit": "ns"
      },
      {
        "name": "week",
        "byte_offset": 8,
        "data_type": "I2",
        "description": "GPS week number of the navigation epoch",
        "unit": "weeks"
      },
      {
        "name": "gpsFix",
        "byte_offset": 10,
        "data_type": "U1",
        "description": "GPSfix Type, range 0..5\n0x00 = No Fix\n0x01 = Dead Reckoning only\n0x02 = 2D-Fix\n0x03 = 3D-Fix\n0x04 = GPS + dead reckoning combined\n0x05 = Time only fix\n0x06..0xff: reserved"
      },
      {
        "name": "flags",
        "byte_offset": 11,
        "data_type": "X1",
        "description": "Fix Status Flags (see graphic below)",
        "bitfield": {
          "bits": [
            {
              "name": "GPSfixOK",
              "bit_start": 0,
              "bit_end": 0,
              "description": "1 = Fix within limits (e.g. DOP & accuracy)"
            },
            {
              "name": "DiffSoln",
              "bit_start": 1,
              "bit_end": 1,
              "description": "1 = DGPS used"
            },
            {
              "name": "WKNSET",
              "bit_start": 2,
              "bit_end": 2,
              "description": "1 = Valid GPS week number (see Time Validity section for details)"
            },
            {
              "name": "TOWSET",
              "bit_start": 3,
              "bit_end": 3,
              "description": "1 = Valid GPS time of week (ITOW & FTOW, see Time Validity section for details)"
            }
          ]
        }
      },
      {
        "name": "ecefX",
        "byte_offset": 12,
        "data_type": "I4",
        "description": "ECEF X coordinate",
        "unit": "cm"
      },
      {
        "name": "ecefY",
        "byte_offset": 16,
        "data_type": "I4",
        "description": "ECEF Y coordinate",
        "unit": "cm"
      },
      {
        "name": "ecefZ",
        "byte_offset": 20,
        "data_type": "I4",
        "description": "ECEF Z coordinate",
        "unit": "cm"
      },
      {
        "name": "pAcc",
        "byte_offset": 24,
        "data_type": "U4",
        "description": "3D Position Accuracy Estimate",
        "unit": "cm"
      },
      {
        "name": "ecefVX",
        "byte_offset": 28,
        "data_type": "I4",
        "description": "ECEF X velocity",
        "unit": "cm/s"
      },
      {
        "name": "ecefVY",
        "byte_offset": 32,
        "data_type": "I4",
        "description": "ECEF Y velocity",
        "unit": "cm/s"
      },
      {
        "name": "ecefVZ",
        "byte_offset": 36,
        "data_type": "I4",
        "description": "ECEF Z velocity",
        "unit": "cm/s"
      },
      {
        "name": "sAcc",
        "byte_offset": 40,
        "data_type": "U4",
        "description": "Speed Accuracy Estimate",
        "unit": "cm/s"
      },
      {
        "name": "pDOP",
        "byte_offset": 44,
        "data_type": "U2",
        "description": "Position DOP",
        "scale": {
          "raw": "0.01",
          "multiplier": 0.01
        }
      },
      {
        "name": "reserved1",
        "byte_offset": 46,
        "data_type": "U1",
        "description": "Reserved",
        "reserved": true
      },
      {
        "name": "numSV",
        "byte_offset": 47,
        "data_type": "U1",
        "description": "Number of SVs used in Nav Solution"
      },
      {
        "name": "reserved2",
        "byte_offset": 48,
        "data_type": {
          "array_of": "U1",
          "count": 4
        },
        "description": "Reserved",
        "reserved": true
      }
    ]
  }
}

